// script to pass values tp Properties file and run the test cases in suite PropertyExpansion import com.eviware.soapui.model.testsuite.TestRunner.Status def tc = testRunner.testCase.testSuite.project.testSuites["TestSuite 1"].testCases["PropertyExpansion"]
tc.testSteps["Properties"].setPropertyValue("SKU","SKU00001") tc.testSteps["Properties"].setPropertyValue("name","MacBook Air") tc.testSteps["Properties"].setPropertyValue("attributeSetId","4") tc.testSteps["Properties"].setPropertyValue("price","100") tc.testSteps["Properties"].setPropertyValue("typeId","simple")
def runner = tc.run(null,false)
log.info "Status=$runner.status, time taken to complete test case is :$runner.timeTaken ms" log.info "number of test steps executed are :"+runner.results.size()

